                'description' => '&nbsp; &nbsp; &nbsp; &nbsp;杭州栖霞岭31号临近岳王庙的一条小巷，一座两层小洋楼隐于林中，穿过沙孟海先生书有“黄宾虹纪念室”六个大字的墙门进入院落，可见一代国画大师黄宾虹先生的雕像立于楼前，布袍长衫，谦恭慈祥，平易朴实。1948年夏，年届85岁的黄宾虹欣然应聘国立杭州艺专教授，从北平南下并于1950年栖居于此，走过了他人生的最后几年，创作了大量的精品佳作，达到了他艺术生涯的顶峰。<br>&nbsp; &nbsp; &nbsp; &nbsp;在20世纪的中国绘画史上，黄宾虹是一位承前启后的山水画大师，是一位“不能仅以画史目之”的学者型艺术家。黄宾虹除山水画外，花鸟画也境界不凡，书法成就更不能等闲视之，有着自己的画学理论建构，还对金石篆刻、文字学、考古学也颇有建树。李可染说:“中国山水画三百年来，黄宾虹一人而已。三百年后，黄宾虹的地位会更高。”',
