                'name' => '“二手烟”比汽车尾气还毒吗？',
                'description' => '&nbsp; &nbsp; &nbsp; &nbsp;吸烟有害人体健康，这是毋庸置疑；汽车尾气排放带来的超高PM2.5值也是人们担忧的重点。《好奇实验室》对于“二手烟”与汽车尾气究竟谁对人体危害更大进行了相关的实验研究。一氧化碳的主要危害是会和红细胞结合，轻则乏力，整个人昏昏沉沉，严重的会导致昏厥窒息。而pm2.5的危害主要集中在呼吸道疾病，哮喘，心血管疾病。<span>按照国家标准，PM2.5的标准为0.075毫克/立方米，而一氧化碳的标准为3.2PPM。</span>根据实验显示，在正常通风的20平米房间内，连抽三根烟，房间里这两个数值都严重超标。在车里抽一根烟,，PM2.5含量为16毫克每立方米，超标213倍，而一氧化碳的浓度为14.7ppm，超标4.6倍。所以，香烟产生的PM2.5真的比汽车尾气还要多。<br>',
