                'description' => '&nbsp; &nbsp; &nbsp; &nbsp;继《我承认我不曾历经沧桑》面世之后，时隔一年，青年作家蒋方舟首部短篇小说集《故事的结局早已写在开头》于近日上市。今天下午，蒋方舟来到杭州庆春购书中心和读者见面。&nbsp;&nbsp;&nbsp;&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp;她在接受记者采访时说，首部短篇小说集《故事的结局早已写在开头》创作用了一年半的时间，之所以会选择短篇小说集，是因为生活中的丰富既是碎片化的，也是转瞬即逝的，所以希望用短篇的方式来记录下它们。&nbsp;&nbsp;&nbsp;&nbsp; “相较于青春题材，我更偏爱写中年人的故事，生活中我也比较喜欢和成熟的人接触，所以这本书把视角聚焦为成人社会，书中所有人物都是比我年纪大很多的，我爱他们身上的无能为力和荒谬。”蒋方舟说，因此才诞生了这部短小说集。<span>&nbsp;&nbsp;&nbsp;&nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp;在此之前，蒋方舟的作品以杂文、散文为主，此次从非虚构写作到虚构写作，是蒋方舟的一次对短篇小说集的写作尝试。 蒋方舟说，《故事的结局早已写在开头》讲述了九个有关“逃离”的故事。“这九个故事可以独立着看，也能连在一起看，这比普通的短篇小说集更有连贯性，也比单独的长篇小说的人物、故事情节更丰富、完整。”</span>',
