                    'property_id' => 7,
                    'name' => '《二泉映月》',
                    'description' => '新编越剧《二泉映月》取材于民间盲人艺术家华彦均（阿炳）的坎坷生命与艺术创作历程。盲人艺术家阿炳，亲历清末、民初、抗战、新社会四个中国近、现代最为动荡的历史阶段，饱尝辛酸，最终创作了二胡名曲《二泉映月》。这一乐曲，以其独特的演奏技巧和民间音乐风格，浓缩映射着个体生命轨迹与时代风云诡谲碰撞的音符，感动着中外无数听众与音乐家。新作汲取了既有关于这一题材所有艺术创作的经验与教训，立足当下社会的文化语境，以盲人艺术家阿炳横跨半个多世纪的苦难人生历程为线索，深入挖掘阿炳的灵魂境遇，构建其生命特质与音乐灵魂，塑造阿炳这一伟大的民间音乐艺术家形象。二胡名曲《二泉映月》亦将作为主要音乐元素，贯穿全剧。<br>',
