            116 => [
                'id' => 617,
                'user_id' => 1,
                'property_id' => 19,
                'name' => '《春琴传》',
                'description' => '<div>&nbsp; &nbsp;&nbsp;《春琴传》是<a target="_blank" rel="nofollow" href="http://baike.baidu.com/subview/1554/14766485.htm">日本</a><a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/476004.htm">著名</a><a target="_blank" rel="nofollow" href="http://baike.baidu.com/subview/176779/7073191.htm">作家</a><a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/15405.htm">谷崎润一郎</a>的作品，隽永细腻，质朴凄美，<a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/649.htm">人文</a>内涵深刻，非常适合<a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/16781.htm">越剧</a>艺术缠绵娓婉、优美动人的<a target="_blank" rel="nofollow" href="http://baike.baidu.com/subview/958755/17962583.htm">表演</a>风格。由<a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/476004.htm">著名</a>影星<a target="_blank" rel="nofollow" href="http://baike.baidu.com/subview/26362/7686723.htm">山口百惠</a>和<a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/93623.htm">三浦友和</a>联袂出演的电影《春琴抄》曾在上个世纪七八十年代<a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/517178.htm">风靡</a><a target="_blank" rel="nofollow" href="http://baike.baidu.com/subview/1554/14766485.htm">日本</a>。<br></div><div>&nbsp; &nbsp; &nbsp;“这样的背景为中国越剧进入域外市场提供了良好基础，借助域外观众已经熟悉的故事，可以缩短中外观众的审美差异，使得中国越剧以崭新的风貌在更为广阔的层面上赢得认知度，这正是<a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/79946.htm">浙江小百花越剧团</a>选择投排该剧的意义所在。”团长<a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/162210.htm">茅威涛</a>如是说。</div><div>&nbsp; &nbsp;&nbsp;《春琴传》是一部时尚越剧，也被观众称为越剧版的《<a target="_blank" rel="nofollow" href="http://baike.baidu.com/subview/30212/6217093.htm">我的野蛮女友</a>》，以开阔的国际化视野为背景，由新生代演员担纲主演，是越剧《春琴传》的一大<a target="_blank" rel="nofollow" href="http://baike.baidu.com/subview/643247/12526910.htm">亮点</a>。在这部专门为新生代演员投排的新剧里，被广大观众亲切称为“小茅威涛”的<a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/1256882.htm">蔡浙飞</a>在剧中饰演佐助，二十岁出头的<a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/1504340.htm">章益清</a>饰演盲妇春琴，“小百花”其他新生代演员在该剧中亦有精彩亮相。</div><div>&nbsp; &nbsp;&nbsp;该剧自2006年3月22日、23日在杭州大剧院首演后，<a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/79946.htm">浙江小百花越剧团</a>曾携《春琴传》到日本、韩国、新加坡等地巡演，并在2006年全国地方戏优秀剧目评比展演中荣获“剧目一等奖”，在2007年第八届中国艺术节上获得多项“文华奖”，同年参加浙江省第十届戏剧节获“剧目大奖”。</div><div>&nbsp; &nbsp;&nbsp;该剧大手笔的投入和剧团的倾心打造，加之演员的精彩表现，让浙江小百花的新生代一举奠定其在越剧界的地位。</div>',
