            152 => [
                'id' => 653,
                'user_id' => 1,
                'property_id' => 19,
                'name' => '新版《陈三两》',
                'description' => '根据<a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/16781.htm">越剧</a>《花中君子》改编，取名《陈三两》。<br>《陈三两》描写才女李素萍，因其父中了进士不交贿金不给官而活活气死，她被迫卖身葬父，并将一半卖身银赠给胞弟李凤鸣读书成才；从此她身落妓院，又以“作文一篇，白银三两”，更名陈三两，卖文不卖身。然因拒嫁富商为妾一案，被贪赃枉法的州官严刑相逼，不料州官并非别人，竟是她离散12年的胞弟李凤鸣，她悲愤欲绝。最后在官至巡按的义弟<a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/921506.htm">陈奎</a>查勘下冤情大白，将李凤鸣削职为民。该剧褪去了越剧的脂粉气息，无关风月的剧情让人耳目一新。<span><br><br></span><br>',
