            156 => [
                'id' => 657,
                'user_id' => 1,
                'property_id' => 19,
                'name' => '舞台中心centre stage栏目：藏书之家',
                'description' => '《藏书之家》是<a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/79946.htm">浙江小百花越剧团</a>历经三年定稿，由茅威涛领衔主演的越剧新创剧目。该剧以中国现存最古老的私人藏书楼<a target="_blank" rel="nofollow" href="http://baike.baidu.com/view/16659.htm">天一阁</a>为背景，通过藏书人范氏两兄弟的曲折经历，描述了古老藏书楼在内忧外患、风雨飘摇的年代里的艰辛境况，刻画了以藏书人范容为代表的那一时代中国传统知识分子的信念和品格，提出一个越来越为当代人关注的文化命题，令我们重新思考千百年来藏书家们“抱残守缺”的文化态度，重新思考在文明的进程中，对文化的保存与传递这类特殊行为内含的价值。该剧同时向观众展示了中国藏书文化的博大精深和一些鲜为人知的藏书知识。',
