            169 => [
                'id' => 670,
                'user_id' => 1,
                'property_id' => 19,
                'name' => '《陆游与唐婉》全剧',
                'description' => '公元1144年，陆游与舅父唐仲俊之女唐婉结婚，陆母怕陆与唐沉醉于两个人的天地中，而影响陆的登科进官，以婚后三年未有子为由，逼其与唐婉离婚。临别时，唐婉送一盆秋海棠给陆作纪念，并说这是断肠红，陆说该称其为相思红才对呀！今后我将飘流在外，此花仍由你好好养护。十年之后，陆回到老家，偶到绍兴有名的沈园去游玩，谁曾想却再这里遇见了昔日恋人唐婉。却得知唐婉与赵士程已经成婚，往昔种种，尽绕心头，感慨万千。于是提笔在壁上题了千古绝唱的钗头凤：第二年春天，唐婉再一次来到沈园，忽然瞥见陆游的题词。反复吟诵，想起往日二人诗词唱和的情景不由得泪流满面心潮起伏，不知不觉中和了一首词，也名钗头凤。表达了旧情难忘而又难言的忧伤情愫，她不久之后便郁郁而死。&nbsp;历经近半个世纪的风雨后，陆游也已至垂暮之年(75岁），仍然把四十多年前那段刻骨铭心的爱情埋在心底。重游沈园，写下沈园二首纪念唐婉一、城上斜阳画角哀，&nbsp;沈园非复旧池台。&nbsp;&nbsp;伤心桥下春波绿，&nbsp;曾是惊鸿照影来。二、&nbsp;梦断香消四十年，&nbsp;&nbsp;沈园柳老不吹绵。&nbsp;此身行在稽山土，&nbsp;&nbsp;犹吊遗踪一泫然。时光易逝，转眼陆游已是风烛残年（81岁）虽不能再亲至沈园寻觅往日的踪影，但他仍对唐婉心生怀念，写下梦游沈园诗&nbsp;一、路近城南已怕行，&nbsp;沈家园里更伤情。香穿客袖梅花在，绿蘸寺桥春水生。二、城南小陌又逢春，&nbsp;只见梅花不见人。玉骨久沉泉下土，&nbsp;墨痕独锁壁间尘。最后，陆游八十五岁那年春日的一天重游沈园，睹物思人，满怀深情地写下了最后一首沈园情诗沈家园里花如锦，半是当年识放翁。也信美人终作土，&nbsp;不堪幽梦太匆匆。',
